import Header from './Header'
import SliceZone from './components/SliceZone'
import Head from 'next/head'
import { Client } from '../prismic-configuration'
import { RichText } from 'prismic-reactjs'
import {Container} from 'react-bootstrap'

const Index = ({doc}) => {
    const banner = doc.data
    const quote = doc.data.body[0].primary
    console.log(banner)
    console.log(quote)
    return (
    <Container className="page-container">
        <Head>
            <title>NGO Example</title>
        </Head>
        {RichText.asText(banner.title)}<br/>
        {RichText.asText(banner.text)}<br/>
        {RichText.asText(banner.button_label)}
        <Header header = {doc.data}/>
        <SliceZone slices={doc.data.body} />
    </Container>
    )
}

export async function getStaticProps() {
    console.log('hello')
    const client = Client();
    const doc = (await client.getSingle("home"))

    return {
        props: {
            doc
        },
    }
}

export default Index;
